(function() {
    'use strict';

    var open = XMLHttpRequest.prototype.open;
    XMLHttpRequest.prototype.open = function(method, url, async, user, pass) {
        console.log("generic request: " + url);
        if (url.indexOf("vod") > -1) {
            console.log("json request");
            this.addEventListener("readystatechange", function() {
                if (this.readyState === 4 && this.status == 200) {
                    // parse content
                    var jsonData = JSON.parse(this.responseText);
                    console.log(jsonData);
                    try{
                        var videoUrl = jsonData.data.vod.video[0].primary;
                        console.log(videoUrl);
                        $('.substance').append('<button class="button" id="DV">下载视频</button>');
                        $('#DV').click(function(){
                            window.open(videoUrl, '_blank');
                        });
                    }
                    catch(e){
                        console.log(e);
                    }
                    try{
                        var audioUrl = jsonData.data.vod.audio[0].primary;
                        console.log(audioUrl);
                        $('.substance').append('<button class="button" id="DA">下载音频</button>');
                        $('#DA').click(function(){
                            window.open(audioUrl, '_blank');
                        });
                    }
                    catch(e){
                        console.log(e);
                    }
                    $(".button").css("color", "white").css("text-align", "center").css("font-size", "16px").css("background-color","#0bb8c2").css("border","none").css("margin","10px 6px").css("padding","10px 25px").css("cursor","pointer");
                };
            }, false);
        }

        open.call(this, method, url, async, user, pass);
    };
})();
